import * as services from "../services/personelServices";

import { useState, useEffect } from "react";

export default function PersonelPage() {
  const [personelList, setPersonalList] = useState();

  useEffect(() => {
    if (!personelList) {
      services.getPersonel().then((res) => {setPersonelList(res.data);console.log(res)});
    }
  }, [personelList]);

  return (
    <table>
      <tr>
        <th>Personel Adı</th>
        <th>Personel Soyadı</th>
        <th>Personel SicilNo</th>
        <th>Personel Birimi</th> 
        <th>Personel Görevi</th>
      </tr>

      {personalList?.map((item) => (
        <tr>
          <td>{item?.personelName}</td>
          <td>{item?.personelSurname}</td>
          <td>{item?.personelSicilNo}</td>
          <td>{item?.personelBirimi}</td> 
          <td>{item?.personelGorevi}</td> 

        </tr>
      ))}
    </table>
  );
}
